function optionGen(id,from,to,label,index,arry,_inner,option,digit){
	var isObj=false;
	var start=from;
	var str="<select id='"+ id +"' name='"+ id +"' "+(option?option:"")+">";
	if(typeof(from)=="object"){
		isObj=true;start=0;to=from.length-1;
	}
	for(var i=start;i<=to;i++){
		str +="<option value='"+(isObj?from[i]:(((digit&&i<10)?"0":"")+i))+"'"+(index?((isObj?from[i]:i)==index?" selected":""):"")+">"+((arry!=null && arry[i])?arry[i]:i)+label +"</option>";
	};
	str+="</select>";
	if(_inner!=null){
		if(_inner=="id"){
			_id("span"+id)._innerHTML=str;
		}else if(_inner=="iddiv"){
			_id("div"+id)._innerHTML=str;
		}else{
			_id(_inner)._innerHTML=str;
		}
	};
	return str;
}
function getChar(i){
	if(i<10){
		i=48+i;
	}else{
		i=i+55;
	}
	var ch=String.fromCharCode(i);
	return ch;
}
function getrid(){
	var str="";
	for(var i=0;i<32;i++){
		str +=getChar(Math.random()*36);
	}
	return str;
}

