function q_sort(L, left, right){
	var l_hold = left;
	var r_hold = right;
	var pivot = L[left];

	while (left < right) {
		while ((L[right]>=pivot) && (left<right)) {
			right--;
		}
		if (left != right){
			L[left] = L[right];
			left++;
		}
		while ((L[left]<=pivot) && (left<right)) {
			left++;
		}
		if (left != right) {
			L[right] = L[left];
			right--;
		}
	}
	
	L[left] = pivot;
	pivot = left;
	left = l_hold;
	right = r_hold;
	
	if (left < pivot) q_sort(L, left, pivot-1);
	if (right > pivot) q_sort(L, pivot+1, right);
}

function quickSort(L){
	q_sort(L, 0, L.length - 1);
}


